                  <br></br><br></br>
                  <button className="btn" style={{color: 'white', width: '100%', height: '40px', backgroundColor: 'rgba(89, 8, 109, 0.688)', borderColor: 'rgba(89, 8, 109, 0.688)'}} variant="primry" type="submit">Submit</button>
              </form>

          </div>
      </div>
  );
};

export default Signup;
